import React from 'react'
import {
  BrowserRouter as Router,

  Route,
  Switch

} from 'react-router-dom'
import './css/App.css'
import HomePage from './pages/HomePage'

import AppBar from './components/AppBar'


function myass(){
  return (
    <div>
      <a>my ass</a>
    </div>
  )
}

function App () {
  return (
    <Router>
      <div>
        <AppBar />
        <Switch>
          <Route path='/dashboard' exact component={HomePage}></Route>
        </Switch>
      </div>
    </Router>
  )
}

export default App
